//! Given a string s, return the number of homogenous substrings of s. Since the answer may be too
//! large, return it modulo 109 + 7.
//!
//! A string is homogenous if all the characters of the string are the same.
//!
//! A substring is a contiguous sequence of characters within a string.
//!
//!
//!
//! Example 1:
//!
//! Input: s = "abbcccaa"
//! Output: 13
//! Explanation: The homogenous substrings are listed as below:
//! "a"   appears 3 times.
//! "aa"  appears 1 time.
//! "b"   appears 2 times.
//! "bb"  appears 1 time.
//! "c"   appears 3 times.
//! "cc"  appears 2 times.
//! "ccc" appears 1 time.
//! 3 + 1 + 2 + 1 + 3 + 2 + 1 = 13.
//!
//! Example 2:
//!
//! Input: s = "xy"
//! Output: 2
//! Explanation: The homogenous substrings are "x" and "y".
//!
//! Example 3:
//!
//! Input: s = "zzzzz"
//! Output: 15
//!
//!
//!
//! Constraints:
//!
//!     1 <= s.length <= 105
//!         s consists of lowercase letters.
//!

mod count_homogenous_1759 {
    /// The function can complete the task by cycling once over the string. The algorithm will have
    /// complexity O(n)
    /// Steps:
    /// 1. Start from the beginning of the string and count the consecutive homogenous characters.
    /// 2. As soon as you encounter two different consecutive characters, stop and save the lenght
    ///    of the consecutive homogenous characters.
    /// 3. Compute all the possible combinations of homogenous substrings in a string of the saved
    ///    length and homogenous characters. The formula is: ```sum_(k=1)^n k```.
    ///    Once simplified with Wolframalpha.com, the alternative form is: ```1/2 n (n + 1)```.
    ///    The semplification was made to have less computations during the calculation.
    /// 4. Start counting again and reapeat steps 2&3 until the end of the string.

    pub fn count_homogenous(s: String) -> i32 {
        let mut result: u64 = 0;
        let mut count = 0;
        let mut prev_char: char = '0';
        for c in s.chars() {
            if count > 0 {
                if c.eq(&prev_char) {
                    count += 1;
                } else {
                    result = result + (count as f64 / 2f64 * (count as f64 + 1.0)) as u64;
                    count = 1;
                    prev_char = c;
                }
            } else {
                count += 1;
                prev_char = c;
            }
        }

        result = result + (count as f64 / 2f64 * (count as f64 + 1.0)) as u64;

        result.rem_euclid(10u64.pow(9) + 7) as i32
    }
}

#[cfg(test)]
mod tests {
    use super::count_homogenous_1759::count_homogenous;

    #[test]
    fn test_example_1() {
        let s = "xy".to_string();

        assert_eq!(2, count_homogenous(s));
    }

    #[test]
    fn test_example_2() {
        let s = "zzzzz".to_string();

        assert_eq!(15, count_homogenous(s));
    }

    #[test]
    fn test_example_3() {
        let s = "abbcccaa".to_string();

        assert_eq!(13, count_homogenous(s));
    }

    #[test]
    fn test_example_4() {
        let s = "".to_string();

        assert_eq!(49965, count_homogenous(s));
    }
}
